import s from './MyPosts.module.css'

const MyPosts = () => {
    return (
    <div>
            <div className={`${s.item} ${s.active}`}>
                My Posts
            </div>
        <textarea>Add post</textarea>
        <button> Remove </button>
            <div>Post 1</div>
            <div>Post 2</div>
    </div>
    )
}
export default MyPosts;
